import React from "react";
import { Home } from "./Box";
import { Map } from "./Map";
//import { Person } from "./Person";
//import { Variant4 } from "./Variant4";
//import { VariantOutline } from "./VariantOutline";
import "./Box.css";

export const Box = () => {
  return (
    <div className="box">
      <div className="group">
        <div className="overlap">
          <div className="overlap-group-wrapper">
            <div className="overlap-group">
              <div className="rectangle" />
              <Person className="person-instance" />
              <VariantOutline className="grid" />
              <Home className="home-instance" />
              <Variant4 className="sparkles" />
              <Map className="map-instance" />
              <div className="div" />
              <div className="rectangle-2" />
            </div>
          </div>
          <img className="phone-image" alt="Phone image" src="phone-image-1-4.png" />
        </div>
      </div>
    </div>
  );
};


export default Box;
